(1, 'Courtesy Copy Delivery', '<p>Since technology has made filing documents online available, we have expanded our services to include delivering courtesy copies to Federal and local courtrooms within the state of California. Hands down, or service can save you precious time and frustration which could have been used more productively on daily tasks rather than saving a few dollars by using a messenger or overnight mail service.</p><p>Some highlights of our services:</p><ul><li>The cost is even lower if you order delivery of courtesy copies along with your court filing order.</li><li>Regardless of the court, Countrywide will produce a presentable copy worthy of anyone&rsquo;s attention.</li><li>Once delivered, an instant notification will be delivered to your inbox and your online account will be updated with the specifics of the delivery.</li></ul><p>We provide Courtesy Copy Delivery Solutions in all California Federal Courts, which are:</p><p><strong>UNITED STATES DISTRICT COURTS</strong></p><p><a target=\"_blank\" href=\"http://www.cacd.uscourts.gov/\">Central District of California</a></p><p><a target=\"_blank\" href=\"https://www.cand.uscourts.gov/home\">Northern District of California</a></p><p><a target=\"_blank\" href=\"http://www.caed.uscourts.gov/caednew/\">Eastern District of California</a></p><p><a target=\"_blank\" href=\"https://www.casd.uscourts.gov/SitePages/Home.aspx\">Southern District of California</a></p><p><strong>UNITED STATES BANKRUPTCY COURTS</strong></p><p><a href=\"http://www.cacb.uscourts.gov/\">Central District of California</a></p><p><a href=\"http://www.caeb.uscourts.gov/\">Eastern District of California</a></p><p><a href=\"http://www.canb.uscourts.gov/\">Northern District of California</a></p><p><a href=\"http://www.casb.uscourts.gov/\">Southern District of California</a></p><p>&nbsp;</p>', 1, '2022-01-20 09:43:35', '2022-02-04 03:29:49', 'uploads/BlogImg-18727courtesy-copy-delivery.jpg', 'courtesy-copy-delivery', 'uploads/BlogDoc-182FAM041 PETITION FOR DISSOLUTION, LEGAL SEPARATION, NULLITY (WITHOUT CHILDREN).pdf'),
