rywide brochure.pdf'),
(30, 'Everything You Need to Know About Domesticating a Subpoena in California', '<p><strong>Introduction</strong></p><p>Those living outside of California and seeking to serve document subpoenas, or deposition subpoenas, to California residents, must follow California law. The Uniform Interstate Depositions and Discovery Act, adopted by over thirty US states, was created in 2007 as a model statute. In January 2010, California enacted the statute. The California version of the model act is found at Cal. Civ. Code &sect;2029.100, et seq. called the Interstate and International Depositions and Discovery Act, California law deems out-of-state counsel who take part in litigation outside of California not to need to initiate any court process in California; therefore, the out-of-state attorney need only retain counsel in California and give him or her a copy of the out-of-state subpoena. U.S. civil procedure. After that, a California lawyer may subpoena an out-of-state recipient just by serving a California subpoena form, along with the out-of-state subpoena, on the California subpoena recipient.</p><p><strong>How do I domesticate a subpoena?</strong></p><p>There are two methods one can use to arrange for out-of-state subpoenas and depositions in California. The first method, which can be complicated, requires one to submit the foreign subpoena to the Clerk of Court in the county in which the discovery is sought, along with the appropriate judicial council form.</p><p><strong>&nbsp;Filing fees and a list of the mandatory forms</strong></p><ul><li>To issue and serve a subpoena, we need the following information for each</li><li>$45.00 filing fee due to the Superior Court.</li><li>Copy of the foreign subpoena issued by the other state.</li><li>Submit your application to <a href=\"https://www.courts.ca.gov/documents/subp030.pdf\">SUBP-030</a>.</li><li>As requested by California, I&#39;ve fulfilled the required request for a subpoena.</li><li>To start, consider courses with titles like <a href=\"https://store.ceb.com/Content/Images/uploaded/jcforms/SUBP035.PDF\">SUBP-035</a>, <a href=\"https://www.courts.ca.gov/documents/subp040.pdf\">SUBP-040</a>, <a href=\"https://store.ceb.com/Content/Images/uploaded/jcforms/SUBP045.PDF\">SUBP-045</a>, or <a href=\"https://www.courts.ca.gov/documents/subp050.pdf\">SUBP-050</a>.</li><li>To testify in a business records matter in California, one needs to pay a $15.00 witness fee at the time of service.</li><li>For all California Appearance Personal Subpoenas, the holder is entitled to witness fees.</li></ul>', 1, '2022-04-19 20:57:24', '2022-04-20 00:57:24', 'uploads/BlogImg-306745SUBPOENA.jpg', 'everything-you-need-to-know-about-domesticating-a-subpoena-in-california', NULL),
