INSERT INTO `services` (`id`, `title`, `details`, `is_active`, `created_at`, `updated_at`) VALUES
(1, 'Our Services', '<p>Countrywide process&nbsp; has been providing legal services for the better part of two decades. We are focused on providing a complete solution to your legal requirements especially legal process services all over California and Nationwide. Whether its filing, recording, delivery, service of process or retrieval, we are always on time. Our timely and hassle-free delivery services have made our clients continuously utilize our services again and again for their legal requirements. With transparent communication and real time online tracking, they always stay at ease and save precious time and effort. Each of our valuable clients experience attentive and personalized services from beginning to end.</p><p>With knowledgeable experts on hand, we confidently present ourselves as one of the most preferred choices all over California including cities such Los Angeles, San Diego, San Jose, San Francisco, Fresno, Sacramento, Long Beach, Oakland, Bakersfield and Anaheim to name just a few. We believe in proving ourselves through our polished services. So you have to try us to believe us.&nbsp;</p>', 1, '2022-01-20 06:01:24', '2022-01-20 00:39:29');
INSERT INTO `service_masters` (`id`, `name`, `image`, `title`, `details`, `is_active`, `created_at`, `updated_at`, `slug_value`, `logo`) VALUES
(27, 'Court Filing', 'uploads/27court-filing4653', 'Court Filling', '<p>Working on a daily basis to meet your needs, Countrywide Process, LLC has an experienced team of couriers, bicyclists, motorcyclists and messengers to complete our court filing service force. All of our Legal Support Service professionals including affiliates and our in house support staff share the same concept and structure to provide consistent, high quality, service no matter what your assignment.</p><p>Our refined services and significant features include:</p><ul><li>Our staff are in constant communication with Court Managers and other staff members to give you real time status of your assignment.</li><li>Confirmation of completed filings are electronically uploaded to our website and an automated email is sent to you with a link to your conformed copies or delivered to your office with the next scheduled pick up.</li><li>Filings that are pending are consistently followed up on and status is given until completion of the assignment.</li><li>We can also assist with the preparation and filing of your Sister State Judgment or with your Petition to an Out of State Subpoena issued in California.</li></ul><p>We also provide legal court e-filing services in major cities such as Alameda, Butte, Calaveras, Fresno, Kern, Kings, Los Angeles, Merced, Monterey, Napa, Orange, San Diego, San Luis Obispo, San Mateo, Santa Barbara, Santa Clara, Santa Cruz, Stanislaus, Sutter, Yuba and counting.</p><p>All our services are aimed at meeting the needs of our clients; we strive for excellence and to make the court filing process flow as smoothly as possible.</p><p><strong>If you don&rsquo;t have an account yet and would like to create one in minutes,&nbsp;<a href=\"https://www.countrywideprocess.com/registration/\">click here</a>.</strong></p><p><strong>Are you ready to have Countrywide Process file and serve your legal documents in California? Click to Place a&nbsp;<a href=\"https://www.countrywideprocess.com/e-filing\">Court Filing Order now</a>.</strong></p><p><strong>Or</strong></p>', 1, '2022-02-03 08:14:59', '2022-09-07 17:59:52', 'court-filing', 'uploads/2751'),
(28, 'Process Serving', 'uploads/28process-serving7610', 'Process Serving', '<p>With over 30 years of experience in the industry, Countrywide Process is capable of handling all types of assignments of process serving in California , no matter how tedious, difficult or complex. We have built a growing base of time tested, experienced, individually registered and bonded process servers which we manage and maintain. CWP&rsquo;s effectuated service of process percentage will not be surpassed by any other reputable service of process company. Each one of our Agents is part of a team that shares the same goal: making sure each job we accept is treated as a top priority and is completed with quality and efficiency in mind.</p><p>We serve process in all major cities of California such as Los Angeles, San Diego, San Jose, San Francisco, Fresno, Sacramento, Long Beach, Oakland, Bakersfield and Anaheim.</p><p>Some highlights of our efficient services include:</p><ul><li>Proofs of services are completed and returned within 72 hours of service being effectuated via email also uploaded to your Countrywide Process account</li><li>We also have considerable experience, resources and expertise concerning Unlawful Detainer / Evictions, Collections, Rent or Quit Notices and Records Subpoenas.</li><li>Track status of your process service order 24 hours a day, 7 days a week directly from your account.</li></ul>', 1, '2022-02-03 08:19:02', '2022-02-03 02:50:40', 'process-serving', 'uploads/28process-serving91'),
(29, 'eRecording', 'uploads/29erecording8709', 'eRecording', '<p>Document Recording refers to the task of a recording of a legal document with the County Recorders Office. Once documents such as deeds, mortgage notes, or satisfaction of mortgage or judgment are recorded they become an official public record. Countrywide Process has the capability of completing document recordings quickly and efficiently throughout California. As with all the documents we receive and record, we make sure to get the documents back to our clients at an expedited rate. Once your document is recorded, you will receive confirmation of the recording along with an instrument number and a copy of the recording within a short number of days.</p><ul><li>e-recording is still not mandatory, so you will need to place your order online and upload the scan of the original document(s) in Black &amp; White ( not color ). Once you place your order online, an order confirmation will be sent to you via email. Upon completion, you will receive a follow-up email with a copy of your recorded document or a rejection notice.</li></ul><p>We provide Recording services in counties such as&nbsp;<strong>Alameda, Butte, Calaveras, Contra Costa, El Dorado, Fresno, Kern (coming soon ), Los Angeles, Madera, Marin, Merced, Modoc, Mono, Monterey, Napa, Nevada, Orange, Placer, Riverside, Sacramento, San Bernardino, San Diego, San Joaquin, San Luis Obispo, San Mateo, Santa Barbara, Santa Clara, Santa Cruz, Shasta, Solano, Sonoma, Tehama, Tulare, Ventura, Yuba&nbsp;</strong>as well as all other counties throughout California.</p>', 1, '2022-02-03 08:22:02', '2022-02-03 02:52:02', 'erecording', 'uploads/2937'),
(30, 'County Recording', 'uploads/30courtesy-copy5174', 'County Recording', '<p>Since technology has made filing documents online available, we have expanded our services to include delivering courtesy copies to Federal and local courtrooms within the state of California. Hands down, or service can save you precious time and frustration which could have been used more productively on daily tasks rather than saving a few dollars by using a messenger or overnight mail service.</p><p>Some highlights of our services:</p><ul><li>The cost is even lower if you order delivery of courtesy copies along with your court filing order.</li><li>Regardless of the court, Countrywide will produce a presentable copy worthy of anyone&rsquo;s attention.</li><li>Once delivered, an instant notification will be delivered to your inbox and your online account will be updated with the specifics of the delivery.</li></ul><p>We provide Courtesy Copy Delivery Solutions in all California Federal Courts, which are:</p><p><strong>UNITED STATES DISTRICT COURTS</strong></p><p><a target=\"_blank\" href=\"http://www.cacd.uscourts.gov/\">Central District of California</a></p><p><a target=\"_blank\" href=\"https://www.cand.uscourts.gov/home\">Northern District of California</a></p><p><a target=\"_blank\" href=\"http://www.caed.uscourts.gov/caednew/\">Eastern District of California</a></p><p><a target=\"_blank\" href=\"https://www.casd.uscourts.gov/SitePages/Home.aspx\">Southern District of California</a></p><p><strong>UNITED STATES BANKRUPTCY COURTS</strong></p><p><a href=\"http://www.cacb.uscourts.gov/\">Central District of California</a></p><p><a href=\"http://www.caeb.uscourts.gov/\">Eastern District of California</a></p><p><a href=\"http://www.canb.uscourts.gov/\">Northern District of California</a></p><p><a href=\"http://www.casb.uscourts.gov/\">Southern District of California</a></p>', 1, '2022-02-03 08:23:58', '2022-02-25 02:51:40', 'county-recording', 'uploads/3012'),
(31, 'Research and Retrieval', 'uploads/31research-and-retrieval5978', 'Research and Retrieval', '<p>As part of the many services we offer, Countrywide Process can also research and obtain any documentation our clients may need. We update you every step of the way so you know the progress made on your order.</p><p>We offer research &amp; retrieval services in California, including all the major cities such as Los Angeles, San Diego, San Jose, San Francisco, Fresno, Sacramento, Long Beach, Oakland, Bakersfield and Anaheim.</p><p>Service features:</p><ul><li>Once the requested copies have been obtained, your documents are sent to you right away</li><li>Also they are stored in your CWP account for future access.</li></ul><p>We provide Public Records Court Research and Document Retrieval for General Civil Filings, including but not limited to:</p>', 1, '2022-02-03 08:25:18', '2022-02-03 02:55:18', 'research-and-retrieval', 'uploads/3120');
