INSERT INTO `testimonials` (`id`, `author_name`, `is_active`, `created_at`, `updated_at`, `details`, `image`) VALUES
(1, 'Benjamin Jesudasson', 0, '2022-01-20 07:44:16', '2022-09-07 18:03:34', '<p>Countrywide Process LLC will go the extra mile to ensure quick and efficient delivery of your court documents, on time, every time. Call us today for your order!</p><p>I truly had an amazing experience with your company. I had a very important court hearing for which the rules required personal service for 32 entities. The court would have continued the matter even if one of the recipients was not served or served properly. I didn&rsquo;t have a choice but to reach out to Countrywide on a holiday weekend and get the help I did. They served my 32 entities over the course of two days. You were a part of my big court victory. I am happy and my clients are happy!!!!! Thank you.</p>', ''),
(3, 'Robert Zeman', 1, '2022-01-20 08:23:46', '2022-01-20 02:53:46', '<p>Jack and crew have bailed me out too many times to count. Top notch service!</p>', ''),
(4, 'Teena Sanders', 1, '2022-01-20 08:24:11', '2022-01-20 02:54:11', '<p>Their services are quick and reliable. I would recommend any law firm to use them.</p>', ''),
(5, 'Han MeeShee', 1, '2022-01-20 08:24:34', '2022-01-20 02:54:34', '<p>Easy to get someone on the phone. Answered my questions. Work was done quickly and they emailed me copies of filed docs. Will use them again.</p>', ''),
(6, 'Richard A Lefkowitz', 1, '2022-01-20 08:25:02', '2022-01-20 02:55:02', '<p>After many difficult encounters with other attorney services, it was a great relief to finally find the friendly folks at Countrywide. Their years of experience, dedication, and uncommon diligence have taken them to the top of their trade and they have been an indispensable element in the smooth operation of this firm. They are unmatched in quality, service, and follow-up; simply, the best in the business.</p>', '');
